import React from 'react';
import CommunButton from '../../../components/CommunButton';

import {
  Container,
  ImageContainer,
  PhoneAppImage,
  InfoContainer,
  Title,
  Subtitle,
  Description,
  StoresContainer,
  StoreImage,
} from './styles';

const SessionThree = (): JSX.Element => {
  return (
    <Container>
      <ImageContainer>
        <PhoneAppImage />
      </ImageContainer>
      <InfoContainer>
        <Title>Are you a professional ?</Title>
        <Subtitle>Do you need extra income?</Subtitle>
        <Description>
          {`toSupply receives more than 50 thousand orders every month from
          customers looking for professionals like you. ${'<br>'} Register your services
          and receive requests directly from your cell phone.`}
        </Description>
        <CommunButton />
        <StoresContainer>
          <StoreImage />
          <StoreImage />
        </StoresContainer>
      </InfoContainer>
    </Container>
  );
};

export default SessionThree;
